import { useParams } from "react-router-dom";
export default function AvailableCabs({cab})
{

    console.log(cab)
    const params=useParams();
    const {id}=params;
    const cabAgencyId=id;


    return(
        <div>
            <h3>{cab.cabId}</h3>
            <h3>{cab.cabModel}</h3>
            <h3>{cab.ac}</h3>
            <h3>{cab.numberOfSeats}</h3>
            <h3>{cab.vehicleNumber}</h3>
            <h3>{cab.pickUpPoint}</h3>
            <h3>{cab.dropPoint}</h3>
            <h3>{cab.fair}</h3>

        </div>


    )

}
